// 25,135,84
function createDivRow(data1, data2, imagem) {
    return `<div class="col border-bottom border-top border-1 border-success rounded rounded-5" style="background: rgba(25, 135, 84, ${data1 / data2});">
                <p class="lead text-center my-auto">
                    <img width="42px" src="${imagem}">
                    <strong>${data1}</strong> / ${data2}
                </p>
            </div>`;
}

function createStats() {
    var pythonFeito = 0;
    var pythonTotal = 0;
    var rubyFeito = 0;
    var rubyTotal = 0;
    var javascriptFeito = 0;
    var javascriptTotal = 0;
    var phpFeito = 0;
    var phpTotal = 0;
    for (n in myProgress) {
        for (j in myProgress[n]) {
            if (myProgress[n][j].python == true) {
                pythonFeito++;
                pythonTotal++;
            } else {
                pythonTotal++;
            }
            if (myProgress[n][j].ruby == true) {
                rubyFeito++;
                rubyTotal++;
            } else {
                rubyTotal++;
            }
            if (myProgress[n][j].javascript == true) {
                javascriptFeito++;
                javascriptTotal++;
            } else {
                javascriptTotal++;
            }
            if (myProgress[n][j].php == true) {
                phpFeito++;
                phpTotal++;
            } else {
                phpTotal++;
            }
        }
    }
    var imgPython = `data:image/png;base64,`;
    var imgRuby = `data:image/png;base64,`;
    var imgJavascript = `data:image/png;base64,`;
    var imgPHP = `data:image/png;base64,`;

    var outputText = '';
    outputText += createDivRow(pythonFeito, pythonTotal, imgPython);
    outputText += createDivRow(rubyFeito, rubyTotal, imgRuby);
    outputText += createDivRow(javascriptFeito, javascriptTotal, imgJavascript);
    outputText += createDivRow(phpFeito, phpTotal, imgPHP);

    return outputText;
}

var linha = document.getElementById('statistic');
linha.innerHTML = createStats();

const file = `./content.json`;
var target = document.getElementById('target');
target.innerHTML = '';

function gerarID() {
    var conteudo = "abcdefghijklmnopqrstuvxyz"
    var id = "";
    for (var i = 0; i < 8; i++) {
        var indice = Math.floor(Math.random() * conteudo.length);
        id += conteudo[indice];
    }
    return id
}

var progressLang = [];

function addAcordeon(cont, title, itens) {
    var id = gerarID();
    var accItem = `<h1 class="display-5">${title}</h1>`;
    var collect = [];
    for (n in itens) {
        let progress = ''
        let contador = 0;
        if (myProgress[cont][n].python == true) {
            progress += '<img  width="42px" src = "data:image/png;base64," > ';
            contador++;
        }
        if (myProgress[cont][n].ruby == true) {
            progress += '<img  width="42px" src="data:image/png;base64,">';
            contador++;
        }
        if (myProgress[cont][n].javascript == true) {
            progress += '<img  width="42px" src="data:image/png;base64,">';
            contador++;
        }
        if (myProgress[cont][n].php == true) {
            progress += '<img width="42px" src="data:image/png;base64,">';
            contador++;
        }
        let background;
        switch (contador) {
            case 0:
                background = 'bg-success bg-opacity-10';
                break;
            case 1:
                background = 'bg-success bg-opacity-25';
                break;
            case 2:
                background = 'bg-success bg-opacity-50';
                break;
            case 3:
                background = 'bg-success bg-opacity-75';
                break;
            case 4:
                background = 'bg-success bg-opacity-100';
                break;
        }

        let question = itens[n].replace(/<p>/g, "<p class='lead fl-norecued'>")
            .replace(/<li>/g, `<li class='list-group-item bg-transparent'>`)
            .replace(/<ul>/g, `<ul class='list-group list-group-flush mx-4'>`)
            .replace(/<table>/g, `<table class='table m-auto w-50 bg-transparent'>`)
            .replace(/<td>/g, `<td class='bg-transparent' >`)
            .replace(/<td class='text-center'/g, `<td class='text-center bg-transparent'`);

        accItem += `<div class="${background} my-2 p-2 rounded rounded-2"><p class='lead fl-norecued'>${progress}</p><p class="lead fl-recued">${parseInt(n) + 1} - ${question}</p></div>`;
        let message = { python: false, ruby: false, javascript: false, php: false };
        collect.push(message);
    }
    progressLang.push(collect)
    return accItem;
}

fetch(file).then(response => {
    return response.json();
}).then(data => {
    var dados = data.topic;
    var itens = [];
    var title = '';
    for (n in dados) {
        title = dados[n].title;
        for (j in dados[n].questions) {
            itens.push(dados[n].questions[j]);
        }
        target.innerHTML += addAcordeon(n, title, itens);
        title = "";
        itens = [];
    }

})
